import React from 'react';
import './index.css';
import { Link } from 'react-router-dom';
function Login() {
  
 
  return (
    <div className="login">
      <h2 className="login">LogIn</h2>
        <label htmlFor="email">Email:</label>
        <input type="email" id="email" className="email" required />
        <label htmlFor="password">Password:</label>
        <input type="password" id="password" className="password"  required />
        <Link to="/home"><input type="submit" value="LogIn" /></Link>
        <Link to="/signup" className="direct"><h4 className="direct">Back to SignUp</h4></Link>
    </div>
  );
}

export default Login;
